import React from 'react';
import logo from './logo.svg';
import { Button, Pane, Tab, TabNavigation, majorScale, Heading } from 'evergreen-ui'
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import MainPage from './Pages/MainPage';
import InfoPage from './Pages/InfoPage';
import Scores from './Pages/Scores';
import Rules from './Pages/Rules';
import Participate from './Pages/Participate';
import Contact from './Pages/Contact';

export default function WebPages() {
    return (
        <BrowserRouter>
            <Pane height={majorScale(6)} flex={0} alignItems="center" display="flex" justifyContent="center">
                <TabNavigation>
                    {['Home Page', 'Information', 'Rules', 'Participate', 'Contact', 'Scores'].map((tab, index) => (
                        <Tab key={tab} is="a" href={(tab !== 'Home Page') ? tab : "/"} id={tab}>
                            {tab}
                        </Tab>
                    ))}
                </TabNavigation>
            </Pane>
            <Pane height={majorScale(6)} flex={0} alignItems="center" display="flex" justifyContent="center">
                <Heading is="h1" size={900}>TAPC 2020 Programming Contest</Heading>
            </Pane>

            <Switch>
                <Route exact path="/">
                    <MainPage />
                </Route>
                <Route exact path="/Information">
                    <InfoPage />
                </Route>
                <Route exact path="/rules">
                    <Rules />
                </Route>
                <Route exact path="/participate">
                    <Participate />
                </Route>
                <Route exact path="/contact">
                    <Contact />
                </Route>
                <Route exact path="/scores">
                    <Scores />
                </Route>
            </Switch>
        </BrowserRouter>

    );
}
